import React, { FC } from 'react';
import './styles.css';


export interface ButtonProperties {
    text: string;
    type: 'primary' | 'secondary';
    onClick: () => void;
}

const Button: FC<ButtonProperties> = props => {
    const {
        text,
        onClick
    } = props;

    return (
        <div className="button" onClick={onClick}>{text}</div>
    );
};

export default Button;
